import React from 'react';
import { getFineDustLevel, getUltraFineDustLevel } from '../utils/airQualityUtils';

function DustCard({ fine, ultraFine }) {
  const fineLevel = getFineDustLevel(fine);
  const ultraLevel = getUltraFineDustLevel(ultraFine);

  return (
    <div className="card">
      <h4 className="card-title">미세먼지 정보</h4>
      <div className="card-content">
        <img src="/images/fine.png" alt="미세먼지" />
        <p><b>미세먼지</b></p>
        <p className="dust-value">{fine} ㎍/㎥</p>
        <p className={`dust-status ${fineLevel.color}`}>{fineLevel.label}</p>
        <div className={`dust-bar ${fineLevel.color}`} />

        <img src="/images/ultrafine.png" alt="초미세먼지" />
        <p><b>초미세먼지</b></p>
        <p className="dust-value">{ultraFine} ㎍/㎥</p>
        <p className={`dust-status ${ultraLevel.color}`}>{ultraLevel.label}</p>
        <div className={`dust-bar ${ultraLevel.color}`} />

        <p className="card-footer">
          &gt; 마스크 추천 제품 &lt;<br />
          &gt; 미세먼지 건강 정보 &lt;
        </p>
      </div>
    </div>
  );
}

export default DustCard;
